window = sg.Window('PyAerocounter GUI BY RENÊ E VICTOR', layout)

while True:
    
    event, values = window.read()
    if event == sg.WIN_CLOSED :
        break   
    Save_logfile=values['logfile']     # OPÇÃO DE SALVAR TXT COM O RESULTADO D CONTAGEM DE PALAVRAS (CONFERIR LINHA 379 DO  Script)

    C_and_R=values['Cab_Rod']          # SELECIONAR SE O MODELO DO PDF TEM CABECALHO E RODAPÉ (CONFERIR LINHA 214 A 218 DO Script) Resolve o bug que ignora a contagem de palavras do primeiro paragrafo de um arquivo sem cabecalho, desmarcando a opção
    
    pdffile=values['File']             # CAMINHO DO PDF SELECIONADO PARA A CONTAGEM
    pdffile=pdffile.replace('/' , '\\')# CORREÇÃO DO CAMINHO DO PDF PARA USAR NO CMD (CONFERIR LINHAS 295 a 302 DO Script)
    images_folder=values['Folder']     # CAMINHO DA PASTA ONDE SERÃO SALVAS AS IMAGENS DO PDF
    images_folder=images_folder.replace('/' , '\\') #CORREÇÃO DO CAMINHO DA PASTA PARA O CMD MOVER AS IMAGENS
    ##----------------------------------VERIFICAÇÃO SE O PDF SELECIONADO EXISTE----------------------------
    Verific=os.path.isfile(pdffile)
    if not Verific:
        continue


    ##---------------------------------- RODA A ROTINA DO PyAeroCunter-------------------------------------
    countwords_text,countnonwords_text,countfigures,countwords,countnonwords,number_of_pages,count_mathwords = PyAeroCounter_function(C_and_R,Save_logfile,pdffile,images_folder)

    ##---------------------------------------POP UP CONTAGEM TERMINADA-------------------------------------

    sg.Popup('CONTAGEM TERMINADA')

    ## --------------------------- ATUALIZA OS DADOS NO CONTADOR (NÚMERO DE PALAVRAS)----------------------
    line1=('Words: '+str(countwords_text))
    line2=('Non-Words: '+str(countnonwords_text)) 
    line3=('Figures Files: '+str(countfigures))
    line4=('Words in Figures: '+str(countwords))
    line5=('Non-Words in Figures: '+str(countnonwords))
    line6=('Num. of Pages: '+str(number_of_pages))
    line7=('Words in Math Mode (Microsoft Word): '+str(count_mathwords))
    window['-RESULTADOS-'].update([line1,line2,line3,line4,line5,line6,line7])


window.close()
